import React from 'react';

export default function(props)
{
    return(
        <ul>
            {
                props.todo.map((item,i)=>{
                    return (
                        <li key={i}>{item}
                            <button key={i} onClick={props.deleteItem(i)} style="float:right">Delete</button>
                        </li>
                    )
                })
            }
        </ul>
    )
}
